import React, { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import axios from './api/axios'
import Header from './Header'
const ORDER_URL = '/v1/order'

const Profile = () => {
    const [order, setOrder] = useState()
    let [user, setUser] = useState()
    useEffect(() => {
        getUser()
    }, [!user])

    const getUser = () => {
        let user = JSON.parse(localStorage.getItem('user'));
        setUser(user)
    }
    useEffect(() => {
        orderList()
    }, [!order])

    const navigate = useNavigate()
    const orderList = async() => {
        const response = await axios.get(`${ORDER_URL}`)
        // const response = [
        //     {
        //         id: 1,
        //         amount: 200,
        //         imageUrl: '',
        //         itemName: 'Reebok shoes',
        //         description: 'This is reebok shoes'
        //     }
        // ]
        setOrder(response)
    }
    return (
        <div className='container-fluid profile-container'>
            <Header />
            <div className="row">
                <div className="col-md-12 profile-head">
                    <p><b>Welcome {user?.username}</b> | {user?.email}</p>
                </div>
                <div className="col-md-12">
                    <div className="row">
                        <div className="col-md-12">
                            <h5 className='text-center'>Your Orders</h5>
                        </div>
                    </div>
                    <div className="row">
                        {order ? order.map(element => {
                            return (<div className='col-md-3 mb-2' key={element?.id}>
                                <div className="card" style={{ width: "15rem" }}>
                                    <img src={element?.imageUrl} className="img-fluid card-image" alt="" />
                                    <div className="card-body">
                                        <h5 className="card-title">₹{element?.amount}</h5>
                                        <p className="card-text">{element?.itemName}</p>
                                        <p className="card-text">{element?.description}</p>
                                        <a className='btn btn-outline-primary' onClick={() => navigate('/order')}>Order Details</a>
                                    </div>
                                </div>
                            </div>)
                        }) : <></>}
                    </div>
                    <div className='row'>
                        <div className="col-md-12 p-2">
                            <table className='table'>
                                <thead>
                                    <tr>
                                        <th>Name</th>
                                        <th>Price</th>
                                        <th>Quantity</th>
                                        <th>Total</th>
                                        <th>Action</th>
                                    </tr>
                                </thead>
                                {
                                    order === undefined ? <tbody>
                                        <tr>
                                            <td></td>
                                            <td></td>
                                            <td></td>
                                            <td></td>
                                            <td></td>
                                        </tr>
                                    </tbody> : <tbody>
                                        {/* {
                cart?.item?cart?.item.map((element) => {
                  total += element?.price
                  quantity += element?.quantity
                  return (<tr key={element?.itemId}>
                    <td>{element?.itemName}</td>
                    <td>{element?.cost}</td>
                    <td>{element?.quantity}</td>
                    <td>{element?.price}</td>
                  </tr>)
                }):<></>
              } */}
                                    </tbody>
                                }
                            </table>
                            {/* <h3 id="cart-total">Cart Total</h3>
          <div className='d-flex justify-content-between'>
            <span>Cart Totals</span>
            <span>Number of items: {quantity?quantity:0}</span>
            <span>Total: {total?total:0}</span>
          </div>
          <div className='d-flex justify-content-end pt-5'>
            <button className='btn btn-outline-primary' onClick={()=>onCheckout(cart)}>Checkout</button>
          </div> */}
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Profile
